import { borderRadius } from "@mui/system";
import React from "react";
import SkillBar from 'react-skillbars';

const styleCard = {
  height: "500px",
  width: "60%",
  borderRadius: "20px",
  boxShadow: "0px 8px 16px 0px rgba(0,0,0,0.2)"
}

const styleSkillbar = {
  paddingTop: "100px",
}

function SkillsetCard(props){

    const title = "Programming";
    const skills = [
      { type: 'Java', level: 85 },
      { type: 'Javascript', level: 75 },
    ];


  return (
    <div style={styleCard}>
        <h2 style={{paddingTop:"100px", alignItems:"center", textAlign:"center"}}>{title}</h2>
        <SkillBar style={{styleSkillbar}} skills={skills} height={20} />
    </div>
  )
}

export default SkillsetCard;
